// src/App.js
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import './App.css';
import Centros from './Centros';
import CentroUnico from './CentroUnico';

function App() {
  const [titulo, setTitulo] = useState("Centros Cívicos");

  return (
    <Router>
      <div className="App">
        <header>
          <h1>{titulo}</h1>
          {/* Aquí va el menú de navegación */}
        </header>

        <Routes>
          <Route path="/" element={<Centros />} />
          <Route path="/centro/:id" element={<CentroUnico setTitulo={setTitulo} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
